<script type="text/javascript" src="<?php echo Yii::app()->theme->baseUrl;?>/js/jquery.Jcrop.js"></script>
  <script type="text/javascript">
    jQuery(document).ready(function(){
       var jcrop_api,
        boundx,
        boundy,
        // Grab some information about the preview pane
        $preview = jQuery('#preview-pane');
        
        
      jQuery("input.avatar").change(function(e) {
        
         var input = e.originalEvent.srcElement;
         
         if (input.files && input.files[0]) {
            var reader = new FileReader();

            reader.onload = function (e) {
                
                jQuery('#avatarjcrop')
                    .attr('src', e.target.result)
                    .height(180)
                    ;
                $pimg.attr('src', e.target.result)
                    .height(180);$pcnt = jQuery('#preview-pane .preview-container'),
        $pimg = jQuery('#preview-pane .preview-container img');
        xsize = $pcnt.width();
        ysize = $pcnt.height();
                jQuery('#avatarjcrop').Jcrop({
                    onChange: updatePreview,
                    onSelect: updatePreview,
                    bgOpacity: 0.5,
                    aspectRatio: xsize / ysize
                  },function(){
                    // Use the API to get the real image size
                    var bounds = this.getBounds();
                    boundx = bounds[0];
                    boundy = bounds[1];

                    jcrop_api = this; // Store the API in the jcrop_api variable

                    // Move the preview into the jcrop container for css positioning
                    $preview.appendTo(jcrop_api.ui.holder);
                  });    
            };

            reader.readAsDataURL(input.files[0]);
        }
        });
        
        function updatePreview(c) {
            if (parseInt(c.w) > 0) {
              var rx = xsize / c.w;
              var ry = ysize / c.h;

              jQuery('#x').val(c.x);
              jQuery('#y').val(c.y);
              jQuery('#w').val(c.w);
              jQuery('#h').val(c.h);

              $pimg.css({
                width: Math.round(rx * boundx) + 'px',
                height: Math.round(ry * boundy) + 'px',
                marginLeft: '-' + Math.round(rx * c.x) + 'px',
                marginTop: '-' + Math.round(ry * c.y) + 'px'
              });
        }
    }

  
